/*
 * alive 값이 true이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 false가 되면 무한 루프를 빠져나와 스레드를 자연스럽게 종료한다.
 */
bool alive = true;  // 프로그램의 실행 상태를 나타내는 플래그

pthread_mutex_t mutex = PTHREAD_MUTEX_INITIALIZER;  // 뮤텍스 초기화
pthread_cond_t reader_c = PTHREAD_COND_INITIALIZER; // 리더 조건 변수 초기화
pthread_cond_t writer_c = PTHREAD_COND_INITIALIZER; // 라이터 조건 변수 초기화

int read_count = 0; // 현재 읽고 있는 리더의 수
bool writer_active = false; // 현재 라이터가 활성화 되어 있는지 여부

void *reader(void *arg)
{
    int id = *(int *)arg;
    while (alive) {
        pthread_mutex_lock(&mutex); // read_count에 상호배타적 접근을 위함
        while (writer_active) {
            pthread_cond_wait(&reader_c, &mutex); // 라이터가 활성화 되어 있으면 리더는 대기
        }
        read_count++; // 리더의 수 증가
        pthread_mutex_unlock(&mutex);

        printf("<");
        for (int i = 0; i < L0; ++i) {
            printf("%c", 'A'+id); // 리더의 id에 해당하는 문자 출력
        }
        printf(">");

        pthread_mutex_lock(&mutex);
        read_count--; // 리더의 수 감소
        if (read_count == 0) {
            pthread_cond_signal(&writer_c); // 모든 리더가 끝났으면 라이터를 깨움
        }
        pthread_mutex_unlock(&mutex);
    }
    pthread_exit(NULL);
}

void *writer(void *arg)
{
    int id = *(int *)arg;
    struct timespec req;
    srand(time(NULL));
    while (alive) {
        pthread_mutex_lock(&mutex);
        while (read_count > 0 || writer_active) {
            pthread_cond_wait(&writer_c, &mutex); // 읽고 있거나 다른 라이터가 활성화 되어 있으면 대기
        }
        writer_active = true; // 라이터 활성화 플래그 설정
        pthread_mutex_unlock(&mutex);

        printf("\n");
        switch (id) {
            case 0:
                for (int i = 0; i < L1; ++i) printf("%s\n", img1[i]); // 이미지 출력
                break;
            case 1:
                for (int i = 0; i < L2; ++i) printf("%s\n", img2[i]);
                break;
            case 2:
                for (int i = 0; i < L3; ++i) printf("%s\n", img3[i]);
                break;
            case 3:
                for (int i = 0; i < L4; ++i) printf("%s\n", img4[i]);
                break;
            case 4:
                for (int i = 0; i < L5; ++i) printf("%s\n", img5[i]);
                break;
        }

        pthread_mutex_lock(&mutex);
        writer_active = false; // 라이터 활성화 플래그 해제
        if (!read_count)
            pthread_cond_signal(&writer_c); // 대기 중인 라이터가 있으면 깨움
        
        pthread_mutex_unlock(&mutex);

        req.tv_sec = 0;
        req.tv_nsec = rand() % SLEEPTIME; // 랜덤 시간 동안 대기
        nanosleep(&req, NULL);
    }
    pthread_exit(NULL);
}

int main(void)
{
    int rarg[NREAD], warg[NWRITE];
    pthread_t rthid[NREAD], wthid[NWRITE];
    struct timespec req;

    for (int i = 0; i < NREAD; ++i) {
        rarg[i] = i;
        if (pthread_create(&rthid[i], NULL, reader, &rarg[i]) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }

    for (int i = 0; i < NWRITE; ++i) {
        warg[i] = i;
        if (pthread_create(&wthid[i], NULL, writer, &warg[i]) != 0) {
            fprintf(stderr, "pthread_create error\n");
            return -1;
        }
    }

    req.tv_sec = 0;
    req.tv_nsec = RUNTIME; // 프로그램의 실행 시간 설정
    nanosleep(&req, NULL);

    alive = false; // 프로그램 종료 플래그 설정
    for (int i = 0; i < NREAD; ++i) {
        pthread_join(rthid[i], NULL); // 모든 리더 쓰레드 종료 대기
    }
    for (int i = 0; i < NWRITE; ++i) {
        pthread_join(wthid[i], NULL); // 모든 라이터 쓰레드 종료 대기
    }

    return 0;
}
